import { Component, OnInit } from '@angular/core';
import { FormGroup, Validators } from '@angular/forms';

@Component({
    selector: 'app-inscricao-dialog',
    templateUrl: './inscricao-dialog.component.html'
})
export class InscricaoDialogComponent implements OnInit {

    inscricaoForm: FormGroup;

    decanatos = [
        { id: 1, nome: 'Decanato Norte' },
        { id: 2, nome: 'Decanato Sul' }
    ];

    grupos: any[] = [];
    constructor(
        private fb: FormBuilder
    ) {
        this.inscricaoForm = this.fb.group({
              cpf: ['', Validators.required],
              nome: ['', Validators.required],
              email: ['', [Validators.required, Validators.email]],
              telefone: ['', Validators.required],
              decanatoId: ['', Validators.required],
              grupoOracaoId: ['', Validators.required]
            });
    }

    ngOnInit(): void {

    }
}
